import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Grid from '@material-ui/core/Grid';
import "./style.css";

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: '25ch',
      display: "inline-block",
    },
  },
}));

function InputField(props) {
  const classes = useStyles();

  return (
    <form className={classes.root} noValidate autoComplete="off">
      <TextField id="outlined-basic" label="Where/What" variant="outlined" />
      <TextField id="outlined-basic" label="Bill Total" variant="outlined" />
      <TextField id="outlined-basic" label="Party Size" variant="outlined" />
      <TextField id="outlined-basic" label="Your Amount" variant="outlined" />
      <div class="checkmark" >
        <label>
          <input type="checkbox" />
          <span>Paid</span>
        </label>
        <label>
          <input type="checkbox" />
          <span>Owe</span>
        </label>
      </div>  
    </form>
  );
}

export default InputField;
